import React from 'react';
import styles from './Users.css';

let Users = (props) => {

    if (props.users.length === 0) {

    axios.get("https://social-network.samuraijs.com/api/1.0/users").then(response => {
        props.setUsers([{ id: 1, photoUrl: 'https://whatsism.com/uploads/posts/2018-05/thumbs/1525374264_7f85e7b.jpeg', nickname: 'Admin', password: '12345678' },
        { id: 2, photoUrl: 'https://image.businessinsider.com/5d9ba6645288793e827eebbd?width=1100&format=jpeg&auto=webp', nickname: 'dmjs', password: 'admin' },
        ])

    });

   
}
    return <div>
        {
            props.Users.map(u => <div key={u.id}>
                <span>
                    <div>
                        <img src={u.photoUrl} className={styles.userPhoto} />
                    </div>
                    <div>
                        {u.nickname}
                    </div>
                </span>

            </div>)
        }
    </div>
}

export default Users;
